import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丁日己酉时断</p><p>六丁日生时已酉，学堂遇贵格诚稀；妻子有气食神旺，无破无刑方是奇。</p><p>丁日己酉时，丁火酉上长生，学堂、天乙贵人皆兼得之。</p><p>丁用己为食，辛为财，酉上明己暗辛生旺，文章秀丽，如见卯乙冲破者不贵。</p><p>丁丑日己酉时，辰巳午未申戍年月贵。</p><p>丁卯日己酉时，时日并冲，忧伤妻子，通火气吉。</p><p>忌乙卯字。</p><p>年月有亥未、巳丑，但一字两合，不以冲论。</p><p>丁巳日己酉时，巳酉丑年月，财旺生官，终身富贵。</p><p>亥子亦吉。</p><p>丁未日己酉时，通火气，贵。</p><p>见卯乙癸字不贵。</p><p>丁酉日己酉时，刑害孤恶，通木火月，吉。</p><p>丁亥日己酉时，蹇滞。</p><p>如戊己丙丁年月，居近侍有权。</p><p>卯甲乙寅，西北运，贵。</p><p>丁日酉时终见贵，偏财食遇禄无归；干支生旺凶中吉，冲破财星隐祸机。</p><p>丁日时临己酉，食神旺相生财。</p><p>清闲福禄自然来，一世为人响快。</p><p>君子宽洪海量，常人四海情怀。</p><p>财官双美象中排，一路滔滔无碍。</p>",21),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","212卷 八·六丁日己酉时断.html.vue"]]);export{f as default};
